led: 26,             //  \n    registerFailed: 27,          //  \n    addToCartFailed: 28,         //    \n    checkoutFailed: 29,          //   \n    viewProductFailed: 30,       //   \n    createProductFailed: 31,     //   \n    updateProfileFailed: 32,     //   \n    addImageFailed: 33,          //   \n    addCategoryFailed: 34,       //   \n    switchToLightThemeFailed: 35, //   \n    switchToDarkThemeFailed: 36, //   \n    failedToLoad: 37,            //  \n    buttonNotWorking: 38,        //  \n    removeFromCartFailed: 39,    //    \n    updateCartQuantityFailed: 40, //   \n    loadProductsFailed: 41,      //   \n    loadProductInfoFailed: 42,   //     \n    navigateToProductFailed: 43, //    \n    logoutProjFailed: 44,        //  \n    updateCategoryFailed: 45,    //   \n    updateImageFailed: 46,       //   \n    updateProductFailed: 47,     //   \n    checkoutEmptyCart: 48,       //   ()\n  };\n\n  /**\n   *   API endpoint'.\n   *\n   * @example\n   * this.configService.apiEndpoints.login\n   */\n  readonly apiEndpoints = {\n    login: '/api/login',\n    register: '/api/register',\n    addToCart: '/api/cart/add',\n    checkout: '/api/checkout',\n    viewProduct: '/api/products',\n    createProduct: '/api/products/create',\n    updateProfile: '/api/profile/update',\n    addImage: '/api/products/add-image',\n    addCategory: '/api/categories/add',\n    switchTheme: '/api/settings/switch-theme',\n    removeFromCart: '/api/cart/remove',\n    updateCartQuantity: '/api/cart/update',\n    loadProducts: '/api/products/all',\n    loadProductInfo: '/api/products/info',\n    toggleTheme: '/api/settings/toggle-theme',\n    resetTheme: '/api/settings/reset-theme',\n    logoutProj: '/api/auth/logout-proj'\n  };\n\n  /**\n   *  HTTP-    .\n   *\n   * @example\n   * if (response.status === this.configService.httpStatusCodes.success) { ... }\n   */\n  readonly httpStatusCodes = {\n    // 2xx: \n    success: 200,          //  \n    created: 201,          //  \n    noContent